import React from "react";
import "../css/style.css";
import "../css/exploresection.css";

function ExploreSection() {
  return (
    <div id="exploreSection" className="py-5 explore_our_c">
      <div className="container">
        <div className="row">
          <div className="col-10">
            <h1 className="our-h2 pb-2"> Explore Top Programs </h1>
          </div>
          <div className="col-2">
            <span></span>
          </div>
        </div>
        <div className="row pt-3">
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-1.webp"
                  alt="MERN STACK"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>MERN STACK</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-2.png"
                  alt="Best Java Course"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>Best Java Course</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-3.png"
                  alt=".NET"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>.NET</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-2.png"
                  alt="JAVA FULL STACK DEVELOPER"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>JAVA FULL STACK DEVELOPER</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-5.jpeg"
                  alt="DATA ANALYTICS FOR PROFESSIONAL"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>DATA ANALYTICS FOR PROFESSIONAL</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-6.png"
                  alt="DATA SCIENCE PROFESSIONAL TRAINING"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>DATA SCIENCE PROFESSIONAL TRAINING</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-7.png"
                  alt="Best Python Training Course "
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>Best Python Training Course </strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-8.png"
                  alt="MEAN STACK"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>MEAN STACK</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-9.webp"
                  alt="CYBER SECURITY"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>CYBER SECURITY</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-10.png"
                  alt="BUSINESS ANALYTICS"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>BUSINESS ANALYTICS</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-11.webp"
                  alt="DIGITAL MARKETING"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>DIGITAL MARKETING</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-12.png"
                  alt="WEB DESIGNING"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>WEB DESIGNING</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-13.png"
                  alt="AWS Professional Training"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>AWS Professional Training</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-14.png"
                  alt="Software Testing Course "
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>Software Testing Course </strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-15.webp"
                  alt="ERP SAP Course"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>ERP SAP Course</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-16.png"
                  alt="DATA ANALYTICS USING PYTHON"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>DATA ANALYTICS USING PYTHON</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-17.webp"
                  alt="Generative AI"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>Generative AI</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-18.png"
                  alt="POWER BI"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>POWER BI</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-19.webp"
                  alt="AUTOCAD"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>AUTOCAD</strong>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-md-3 col-sm-6">
            <div className="top-program-item">
              <div className="one">
                <img
                  src="../images/explore-20.png"
                  alt="AZURE TRAINING  COURSE"
                  loading="lazy"
                  width="70"
                  height="70"
                />
              </div>
              <div className="related-course-name">
                <strong>AZURE TRAINING COURSE</strong>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
export default ExploreSection;

